import React from "react";

import "./Title.css";

import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const title = props => (
  <div className="title__row">
    <Row>
      <Container fluid>
        <Row>
          <Col className="title__name">{props.name}</Col>
        </Row>
        <Row>
          {/* <Col className="title__university">{props.university}</Col> */}
        </Row>
        <Row>{/* <Col className="title__field">{props.field}</Col> */}</Row>
        <Row>{/* <Col className="title__extera">{props.extera}</Col> */}</Row>
      </Container>
      <Container className="title__container">
        <Row>
          <Col className="title__extera">{props.extera}</Col>
        </Row>
      </Container>
    </Row>
  </div>
);

export default title;
